On 01.07.2021 @aaichnairport received yet another #CovidVaccine shipment weighing 1600 kg (50 boxes) on @IndiGo6E 601 from @aaipunairport via @BLRAirport.

@aaichnairport team ensured prompt &amp; safe delivery of the shipment to the consignee.
